import styled from 'styled-components';

export const Container = styled

export const Title = styled.h1 `
    text-align: center;
    font-size: 2rem;
    font-family: sans-serif;
    color: #333;
`
export const List =styled.ul`
    list-style: none;
    padding: 0;
    font-family: sans-serif;
`;

export const ListItem = styled.li`
    margin: .5rem 0;
    background: #000;
    color: #fff;
    padding: .5rem;
`;
